import React from 'react';
import { Link } from 'react-router-dom';
import './styles/Teacher.css';

function Teacher() {
  return (
    <div className="teacher-container">
            <img src={require('../images/logo.png')} alt="Logo" id="logo" height={200} width={200} ></img>

      <h1>Government of Karnataka</h1>
      <p>A fun way to learn maths!</p>
      <div className="button-container">
        <Link to="/Practice"> <button>Edit Practice</button></Link>
        <Link to="/Student-login"><button>Edit Quiz</button> </Link>
        <Link to="/scoreboard"><button>View Scoreboard</button></Link>
      </div>
    </div>
  );
}

export default Teacher;
